 CREATE TABLE campionato (
    id INT AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(100) NOT NULL,
    nazione VARCHAR(200) NOT NULL,
    federazione VARCHAR(100) NOT NULL
);

CREATE TABLE squadra (
    id INT AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(200) NOT NULL,
    citta VARCHAR(150) NOT NULL,
    gol_fatti INT NOT NULL DEFAULT 0,
    gol_subiti INT NOT NULL DEFAULT 0,
    punti INT NOT NULL DEFAULT 0,
    id_campionato INT,
    FOREIGN KEY (id_campionato) REFERENCES campionato(id)
);

CREATE TABLE giocatore (
    id INT AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(200) NOT NULL,
    cognome VARCHAR(200) NOT NULL,
    data_nascita DATE NOT NULL,
    valore VARCHAR(150) NOT NULL,
    id_squadra INT,
    ruolo VARCHAR(50) NOT NULL,
    FOREIGN KEY (id_squadra) REFERENCES squadra(id)
);

CREATE TABLE partita (
    id INT AUTO_INCREMENT PRIMARY KEY,
    id_campionato INT NOT NULL,
    id_casa INT NOT NULL,
    id_trasferta INT NOT NULL,
    data_partita VARCHAR(10) NOT NULL,
    giornata INT NOT NULL,
    gol_casa INT,
    gol_trasferta INT,
    FOREIGN KEY (id_campionato) REFERENCES campionato(id),
    FOREIGN KEY (id_casa) REFERENCES squadra(id),
    FOREIGN KEY (id_trasferta) REFERENCES squadra(id)
);



